aiken/interval/Interval$Int.description:
A type to represent intervals of values. Interval are inhabited by a type
 `a` which is useful for non-infinite intervals that have a finite
 lower-bound and/or upper-bound.

 This allows to represent all kind of mathematical intervals:

 ```aiken
 // [1; 10]
 let i0: Interval<PosixTime> = Interval
   { lower_bound:
       IntervalBound { bound_type: Finite(1), is_inclusive: True }
   , upper_bound:
       IntervalBound { bound_type: Finite(10), is_inclusive: True }
   }
 ```

 ```aiken
 // (20; infinity)
 let i1: Interval<PosixTime> = Interval
   { lower_bound:
       IntervalBound { bound_type: Finite(20), is_inclusive: False }
   , upper_bound:
       IntervalBound { bound_type: PositiveInfinity, is_inclusive: False }
   }
 ```

fields.description:
The pool contracts should work with any order contract that adheres to this datum;
 to aid in extensibility, we leave room here for arbitrary extension data that other
 order scripts might want to take advantage of.

The additional fee, in lovelace, to charge each "strategy" execution;
 This is configurable separately because the DAO may decide to collect more from automated strategies
 or give automated strategies a discount, to incentivize more volume since it's automated.
